import React from 'react';

const PropertyCard = ({ property }) => {
  const { image, title, location, price, area } = property;

  return (
    <div className="relative overflow-hidden rounded-[20px] group cursor-pointer ring-1 ring-black/5 hover:ring-2 hover:ring-blue-400 transition-all duration-300 w-[426px] h-[308px]">
      {/* Image Container with Aspect Ratio */}
      <div className="relative w-full h-full">
        {/* Image */}
        <img
          src={image}
          alt={title}
          className="w-full h-full object-cover"
        />

        {/* Gradient Overlay */}
        <div className="absolute inset-0 bg-gradient-to-t from-[#00513B] via-[#00513B]/40 to-transparent" />

        {/* Content */}
        <div className="absolute inset-0 flex flex-col justify-end">
          {/* Title and Price */}
          <div className="px-6">
            <div className="flex justify-between items-start gap-4">
              <h3 className="text-white text-2xl font-semibold leading-tight mb-6">
                {title}
              </h3>
              <span className="text-white text-2xl font-semibold whitespace-nowrap">
                {price}
              </span>
            </div>
          </div>

          {/* White Line */}
          <div className="h-[1px] bg-white/20 mx-6 mb-4" />

          {/* Location and Area */}
          <div className="px-6 pb-4">
            <div className="flex justify-between items-center">
              <p className="text-white text-base font-bold">
                {location}
              </p>
              <p className="text-white text-base font-bold">
                {area}
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PropertyCard;
